import React from 'react';
import { Container, Typography } from '@mui/material';

const Chat = () => {
    return (
        <Container>
            <Typography variant="h2" component="h1" gutterBottom>
                Chat
            </Typography>
            <Typography variant="body1">
                Engage in real-time chat with other players.
            </Typography>
        </Container>
    );
};

export default Chat;
